import{_ as a,o as e,c as r,O as t}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 2.2-435 Prohibition for state party chairman.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/2.2-435.md","filePath":"vacode/2.2-435.md"}'),i={name:"vacode/2.2-435.md"},o=t('<h1 id="§-2-2-435-prohibition-for-state-party-chairman" tabindex="-1">§ 2.2-435 Prohibition for state party chairman. <a class="header-anchor" href="#§-2-2-435-prohibition-for-state-party-chairman" aria-label="Permalink to &quot;§ 2.2-435 Prohibition for state party chairman.&quot;">​</a></h1><p>The chairman or any full-time paid employee of a state political party, as defined in § <a href="http://law.lis.virginia.gov/vacode/24.2-101/" target="_blank" rel="noreferrer">24.2-101</a>, or a member of his immediate family, as defined in § <a href="http://law.lis.virginia.gov/vacode/2.2-3101/" target="_blank" rel="noreferrer">2.2-3101</a>, shall not be employed as a lobbyist by any principal.</p><p>1994, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0857" target="_blank" rel="noreferrer">857</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0937" target="_blank" rel="noreferrer">937</a>, § 2.1-794; 2001, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0844" target="_blank" rel="noreferrer">844</a>.</p>',3),n=[o];function l(c,s,p,h,_,f){return e(),r("div",null,n)}const g=a(i,[["render",l]]);export{m as __pageData,g as default};
